import React, { Component } from 'react';
import './App.css';
import Icon from './images/gooseberry.png'

const illnesses = [{text:"Common cold"},
  {text:"Nausea"},
  {text:"Mental Health"},
  {text:"Migraines"},
  {text:"Digestive Disorders"},
  {text:"Eye health"},
  {text:"Food Poisoning"},
  {text:"Kidney Stones"},
  {text:"Dermotology"},
  {text:"Menstrual health"},
  {text:"Osteoporasis"},
  {text:"Sleep Disorders"}];
const list = illnesses.map((illness) =>
  <tr>
    <td><img class="icon" src={Icon} alt="gooseberry"/></td>
    <td><h2 class="title"><strong>{illness.text}</strong></h2></td>
    <td><p class="detail"><strong>Rating:</strong> 5/5</p></td>
    <td><p class="detail"><strong>Reviews:</strong> 20</p></td>
  </tr>
);

class List extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <table className="table hover">
            <thead></thead>
            <tbody>{list}</tbody>
          </table>
        </header>
      </div>
    );
  }
}

export default List;
